import React from 'react'
import InputTag from './InputTag'
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';
import AppBar from 'material-ui/AppBar';
import TextField from 'material-ui/TextField';
import RaisedButton from 'material-ui/RaisedButton';
import { withStyles } from '@material-ui/core/styles';
import Input from '@material-ui/core/Input';
import OutlinedInput from '@material-ui/core/OutlinedInput';
import FilledInput from '@material-ui/core/FilledInput';
import InputLabel from '@material-ui/core/InputLabel';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import NativeSelect from '@material-ui/core/NativeSelect';
// import { Button, Form, Grid, Header, Image, Message, Segment, Input, Label } from 'semantic-ui-react'



class InsuredInfo extends React.Component {

   continue = (e) => {
      e.preventDefault()
      this.props.nextStep()
   }

   back = (e) => {
     e.preventDefault()
     this.props.prevStep()
   }

  render(){
    const { handleChange, state, formData, nextStep, prevStep } = this.props

    const inputCollection = formData.page2.map(dataObj => < InputTag key={dataObj.name} dataObj={dataObj} handleChange={handleChange} state={state} />)

    return (
      <MuiThemeProvider>
        <React.Fragment>
          <AppBar title=" INSURED INFORMATION" />
          {inputCollection}

          <InputLabel
            ref={ref => {
              this.InputLabelRef = ref;
            }}
            htmlFor="outlined-age-native-simple"
          >
            Age
          </InputLabel>
          <Select
            native
            value={10}
            onChange={handleChange}
            input={
              <OutlinedInput
                name="3_sex"
                labelWidth={0}
                id="outlined-age-native-simple"
              />
            }
          >
            <option value="" />
            <option value={10}>KKK</option>
            <option value={20}>Twenty</option>
            <option value={30}>Thirty</option>
          </Select>

          <br />

          <RaisedButton
            label="Back"
            primary={false}
            style={styles.button}
            onClick={this.back}
          />

          <RaisedButton
            label="Continue"
            primary={true}
            style={styles.button}
            onClick={this.continue}
          />
        </React.Fragment>
      </MuiThemeProvider>
    )
   }
  }

  const styles = {
    button: {
      margin: 15
    }
  };

export default InsuredInfo
